import React from "react";

import { useSelector } from "react-redux";

const Home = (props) => {
  const my_lists = useSelector((state) => state.dictionary.list);
  //화면 출력
  return (
    <div>
      <div>
        {my_lists.map((list, index) => {
          return (
            <div>
              <div>{list.word}</div>
              <div>{list.explanation}</div>
              <div>{list.example}</div>
            </div>
          );
        })}
      </div>
      <a
        href="/word/add"
        style={{
          width: "50px",
          height: "50px",
          backgroundColor: "blue",
          display: "block",
          borderRadius: "50px",
          position: "fixed",
          right: "10px",
          bottom: "10px",
        }}
      >
        <svg></svg>
      </a>
    </div>
  );
};

export default Home;
